import { Route, Routes } from 'react-router-dom';
import Home from "./componentes/pages/home";
import NotFound from './componentes/pages/notFound';
import Caminho1 from './componentes/pages/caminho1';
import Caminho2 from './componentes/pages/caminho2';
import Caminho3 from './componentes/pages/caminho3';
import Caminho4 from './componentes/pages/caminho4';
import Caminho5 from './componentes/pages/caminho5';




function App() {
  return (
    <div >
      <Routes>
        <Route path='/'element={<Home />} />
        <Route path='/home/caminho1'element={<Caminho1 />} />
        <Route path='/home/caminho2'element={<Caminho2 />} />
        <Route path='/home/caminho3'element={<Caminho3 />} />
        <Route path='/home/caminho4'element={<Caminho4 />} />
        <Route path='/home/caminho5'element={<Caminho5 />} />
        < Route path="*" element={< NotFound />} />

      </Routes>
    </div >
  );
}

export default App;
